  `endTime` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '结束时间yyyy-MM-dd hh:mm',
  `workTime` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '工作单元（分钟数）',
  `agthtype` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '使用的算法',
  `shiftType` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '班次类别（worktime(工时最少), emp（人员最少）, effect（时效最优）, violation（违反规则较少）， fillRate(满足率)）',
  `create_time` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改时间',
  `status` int(11) NOT NULL DEFAULT 1 COMMENT '状态（1：有效，0：无效',
  `scheme_type` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `did` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '',
  PRIMARY KEY (`autoid`) USING BTREE,
  INDEX `sindex`(`cid`, `applyId`, `eid`, `schDay`, `scheme_type`) USING BTREE,
  INDEX `s2index`(`cid`, `eid`, `schDay`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 598363 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

